import React, { Component } from 'react'
import { bindActionCreators } from 'redux'
import { connect } from 'react-redux'
import { chooseCharacter, nextRound, playRound } from '../actions/rounds'
import { browserHistory } from 'react-router'

require('../stylesheets/components/round.sass')

class Round extends Component {
  constructor(props) {
    super(props)

    this.state = {
      currentRound: this.props.currentRound,
      playStarted: false,
      roundComplete: false,
      statusMessage: 'Waiting...'
    }
  }

  componentWillReceiveProps (nextProps) {
    this.setState({ playStarted: nextProps.playStarted })
    if (nextProps.statusMessage) {
      this.setState({ statusMessage: nextProps.statusMessage })
    }

    if (nextProps.roundComplete) {
      this.setState({ roundComplete: true })
    }

    if (nextProps.currentRound && nextProps.currentRound !== this.state.currentRound) {
      browserHistory.push(`/play/${nextProps.currentRound}`)
      this.setState({ currentRound: nextProps.currentRound })
      this.resetState(nextProps.currentRound)
    }
  }

  handleCharacterClick (e) {
    if (!this.state.playStarted) {
      this.setState({ statusMessage: "Let's make this fair. Click the play button first."})
      return
    }

    if (this.state.roundComplete) {
      this.setState({ statusMessage: "This round is complete."})
      return
    }
    this.props.chooseCharacter(e.target.id)
  }

  nextRound () {
    if (this.state.roundComplete) {
      this.props.nextRound(this.state.currentRound + 1)
    }
  }

  playRound () {
    if (this.state.playStarted || this.state.roundComplete) return
    this.props.playRound()
  }

  renderPlayMessage () {
    return (
      <h3>{this.state.statusMessage}</h3>
    )
  }

  resetState (nextRoundNum) {
    this.setState({playStarted: false, roundComplete: false, statusMessage: `Waiting to start round ${nextRoundNum}...`})
  }

  render() {
    const classNames = require('classnames')
    const playClasses = classNames('btn ctr', this.props.className, {
      'disabled btn-default': this.state.roundComplete,
      'btn-primary': !this.state.roundComplete
    })
    const nextClasses = classNames('btn ctr', this.props.className, {
      'disabled btn-default': !this.state.roundComplete,
      'btn-primary': this.state.roundComplete,
    })
    return (
      <div className='round'>
        <h2>Round {this.state.currentRound}</h2>

        <svg width="100%" viewBox="0 0 689 666" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
            <g id="Page-1" stroke="none" strokeWidth="1" fill="none" fillRule="evenodd">
                <g id="adventuretime_shambo">
                    <g id="arrows" transform="translate(82.000000, 181.000000)" stroke="#4990E2" strokeLinecap="square" fill="#4990E2">
                        <path d="M163.5,0.5 L50.5,71.5" id="ik-pb"></path>
                        <path id="ik-pb" d="M50.5,71.5 L61.2407706,68.2944038 L58.0486621,63.2140058 L50.5,71.5 Z"></path>
                        <path d="M0,278 L85.7507234,343.021638" id="pb-f"></path>
                        <path id="pb-f" d="M85.7507234,343.021638 L78.9575948,334.105731 L75.3323602,338.886701 L85.7507234,343.021638 Z"></path>
                        <path d="M67,106 L500.5,106" id="pb-j"></path>
                        <path id="pb-j" d="M500.5,106 L489.7,103 L489.7,109 L500.5,106 Z"></path>
                        <path d="M200.5,354 L321,354" id="f-m"></path>
                        <path id="f-m" d="M321,354 L310.2,351 L310.2,357 L321,354 Z"></path>
                        <path d="M465.5,331.5 L538.5,253.5" id="m-j"></path>
                        <path id="m-j" d="M538.5,253.5 L528.929802,259.33535 L533.310526,263.435259 L538.5,253.5 Z"></path>
                        <path d="M499.5,129.5 L196.5,203.5" id="j-f"></path>
                        <path id="j-f" d="M196.5,203.5 L207.703396,203.85203 L206.279887,198.02334 L196.5,203.5 Z"></path>
                        <path d="M323.5,212.5 L50.5,119.5" id="m-pb"></path>
                        <path id="m-pb" d="M50.5,119.5 L59.7557032,125.822338 L61.6904759,120.142844 L50.5,119.5 Z"></path>
                        <path d="M165.5,198.5 L241.5,83.5" id="f-ik"></path>
                        <path id="f-ik" d="M241.5,83.5 L233.04262,90.8561356 L238.048275,94.1642202 L241.5,83.5 Z"></path>
                        <path d="M498,81 L393,6" id="j-ik"></path>
                        <path id="j-ik" d="M393,6 L400.044607,14.7185729 L403.532036,9.83617208 L393,6 Z"></path>
                        <path d="M355.5,146.5 L296,83" id="m-ik"></path>
                        <path id="m-ik" d="M296,83 L301.195351,92.9321866 L305.573649,88.8296868 L296,83 Z"></path>
                    </g>
                    <g id="bitmaps">
                        <image onClick={(e) => { this.handleCharacterClick(e) }} id="f" x="161" y="390" width="148" height="227" xlinkHref="data:image/png;base64,"></image>
                        <image onClick={(e) => { this.handleCharacterClick(e) }} id="j" x="584" y="253" width="114" height="152" xlinkHref="data:image/png;base64,"></image>
                        <image onClick={(e) => { this.handleCharacterClick(e) }} id="ik" x="253" y="0" width="196" height="253" xlinkHref="data:image/png;base64,"></image>
                        <image onClick={(e) => { this.handleCharacterClick(e) }} id="pb" x="0" y="101" width="113" height="346" xlinkHref="data:image/png;base64,"></image>
                        <image onClick={(e) => { this.handleCharacterClick(e) }} id="m" x="427" y="320" width="94" height="346" xlinkHref="data:image/png;base64,"></image>
                    </g>
                </g>
            </g>
        </svg>

        <div className='input-group'>
          {this.renderPlayMessage()}
          <button className={playClasses} onClick={this.playRound.bind(this)}>Play</button>
          <button className={nextClasses} onClick={this.nextRound.bind(this)}>Next Round</button>
        </div>
      </div>
    )
  }
}

function mapStateToProps (state) {
  return {
    currentRound: state.rounds.currentRound,
    // currentRound: state.rounds.nextRound,
    playStarted: state.rounds.playStarted,
    roundComplete: state.rounds.roundComplete,
    statusMessage: state.rounds.statusMessage
  }
}

function mapDispatchToProps (dispatch) {
  return bindActionCreators({ chooseCharacter, nextRound, playRound }, dispatch)
}

export default connect(mapStateToProps, mapDispatchToProps)(Round)
